import React, { Component } from 'react';
import './allVacations.css';

export default class AllVacations extends Component {

    render() {
        return (
            <div className="allVacationsSection">
                
                <h3 className="favoritesHeader sharp-text">Your 17 Favorite Vacations
                    <svg viewBox="0 0 100 100" preserveAspectRatio="xMidYMid">
                        
                    </svg>
                </h3>

            </div>
        )
    }
}
